import React from "react";
import {
  Box,
  Typography,
  Button,
  Card,
  CardMedia,
  CardContent,
  CardActions,
  Chip,
  Grid,
} from "@material-ui/core";

// import useStyles from "./styles";

const PlacesCard = ({ id, name, location, image }) => {
  //   const classes = useStyles();

  return (
    <Box container noValidate sx={{ mt: 3 }}>
      <Grid item xs={12} sx={{ mt: 3 }} align="center">
        <Card sx={{ maxWidth: 275 }} align="center">
          <CardContent align="center" sx={{ mt: 3 }}>
            {image && (
              <Box
                my={1}
                display="flex"
                justifyContent="space-between"
                alignItems="center"
              >
                <img src={image} alt={name} />
              </Box>
            )}

            {name && (
              <Typography gutterBottom variant="h5">
                {name}
              </Typography>
            )}

            {location && (
              <Typography gutterButtom variant="subtitle1">
                Location: {location}
              </Typography>
            )}
          </CardContent>
          <CardContent align="center">
            <Button size="small" align="right">
              View Games Played
            </Button>
          </CardContent>
        </Card>
      </Grid>
    </Box>
  );
};

export default PlacesCard;
